import Axios from 'axios';

export const createDoctor = async (doctor) => {
  let res = await Axios.get(
    `http://localhost:3000/geocodes/details/${doctor.place_id}`
  );
  const detailedDoctor = res.data.result;
  const {
    formatted_address,
    formatted_phone_number,
    name,
    place_id,
    rating,
    url,
    website,
    user_ratings_total,
    geometry: {
      location: { lat, lng },
    },
  } = detailedDoctor;

  const doctorHash = {
    place_id,
    name,
    formatted_address,
    rating,
    user_ratings_total,
    formatted_phone_number,
    lat,
    lng,
    url,
    website,
  };
  const config = {
    method: 'POST',
    headers: {
      'content-type': 'application/json',
      accepts: 'application/json',
    },
  };
  console.log('doctorHash in helpersJs',doctorHash)
  const bleh = JSON.stringify(doctorHash);
  console.log('doctor in helpersJs',doctor)
  console.log('detailedDoctor in helpersJs',detailedDoctor)



  fetch(`http://localhost:3000/doctors`, config, doctor)
    .then((res) => res.json())
    .then((data) => console.log('data from post', data));


  return doctorHash;
};
